import React from 'react';
import UsersTable from '../components/UsersTable';
import '../assets/css/people.css';

function People() {

    const [users, setUsers] = useState(initialUsers);

    const initialUsers  = [
        {photo: 1, name: 'John Doe', age: 'john@example.com'},
        {photo: 2, name: 'Jane Smith', age: 'jane@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
        {photo: 3, name: 'Mike Johnson', age: 'mike@example.com'},
    ];

    const [searchQuery, setSearchQuery] = useState('');

    const handleSearchChange = (event) => {
        setSearchQuery(event.target.value);
    };

    const filteredUsers = users.filter((user) =>
        Object.values(user).some((value) =>
            value.toString().toLowerCase().includes(searchQuery.toLowerCase())
        )
    );

    return (
        <div className={'content'}>
            <div className={'grid'}>
                <div className={'white_box tabled'}>
                    <div className={'flex'}>
                        <input
                            type="text"
                            placeholder="Поиск..."
                            value={searchQuery}
                            onChange={handleSearchChange}
                            className="search-input"
                        />
                        <UsersTable users={initialUsers}/>
                    </div>
                </div>
                <div className={`white_box`}>
                    <div class={"header"}>
                        <h1>{users[0].name}</h1>
                        <span>Registred at 8 june 2022</span>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default People;
